function PieChartInsights({ colors, td }) {
  const data = [
    {
      key: 1,
      value: 150,
      svg: { fill: colors[0] },
      // arc: { outerRadius: "130%", cornerRadius: 10 },
    },
    {
      key: 2,
      value: 80,
      svg: { fill: colors[1] },
    },
    {
      key: 3,
      value: 40,
      svg: { fill: colors[2] },
    },
  ];

  const data2 = [
    {
      key: 1,
      value: 25,
      svg: { fill: colors[0] },
      arc: { outerRadius: "130%", cornerRadius: 10 },
    },
    {
      key: 2,
      value: 75,
      svg: { fill: colors[2] },
    },
  ];
  return (
    <PieChart
      style={{ height: 100, width: 100 }}
      outerRadius={"70%"}
      innerRadius={!td ? 1 : 20}
      data={!td ? data2 : data}
      startAngle={-180}
    />
  );
}

